|Plot/Storyline|
+--------------+

A young boy stumbles into a mysterious girl with a magic crystal who floats down from the sky. The girl, Sheeta, is being pursued by pirates, the army and the  government's secret agents. Upon saving her life Pazu joins Sheeta in a high-flying adventure to find her real identity and determine for himself his father's involvement with a floating castle of a lost civilization called Laputa.

